        """
        :type edges: List[List[int]]
        :rtype: List[int]
        """

        # 1. build a graph
        # 2. find a cycle
        # 3. find the last edge in the cycle

        # build a graph
        graph = collections.defaultdict(list)
        for u, v in edges:
            graph[u].append(v)

        # find a cycle
        visited = set()
        cycle = None
        for u in graph:
            if u not in visited:
                if self.dfs(u, -1, graph, visited, set()):
                    cycle = (u, -1)
                    break

        # find the last edge in the cycle
        if cycle:
            u, v = cycle
            while u != v:
                v = u
                u = graph[u][0]
            return [u, v]
        else:
            return [max(graph.keys()), max(graph.keys())]

    def dfs(self, u, parent, graph, visited, cycle):
