    def slidingPuzzle(self, board):
        """
        :type board: List[List[int]]
        :rtype: int
        """

        def swap(board, i, j):
            board[i], board[j] = board[j], board[i]
            return board

        def get_zero(board):
            for i in range(len(board)):
                for j in range(len(board[0])):
                    if board[i][j] == 0:
                        return i, j
            return None

        def get_neighbors(board):
            i, j = get_zero(board)
            neighbors = []
            if i > 0:
                neighbors.append(swap(board, i, i-1))
            if i < 1:
                neighbors.append(swap(board, i, i+1))
            if j > 0:
                neighbors.append(swap(board, j, j-1))
            if j < 2:
                neighbors.append(swap(board, j, j+1))
            return neighbors

        def get_goal(board):
            goal = [[1,2,3],[4,5,0]]
            for i in range(len(board)):
                for j in range(len(board[0])):
                    if board[i][j] != goal[i][j]:
                        return False
            return True

        def bfs(board):
            queue = [(board, 0)]
            visited = set()
            while queue:
                board, moves = queue.pop(0)
                if get_goal(board):
                    return moves
                for neighbor in get_neighbors(board):
                    if neighbor not in visited:
                        visited.add(tuple(neighbor))
                        queue.append((neighbor, moves+1))
            return -1

        return bfs(tuple(board))

